const ListProducts = ({ datas }) => {
  return (
     datas.map((data) => (
        <div className="ListProducts">
        <ul>
         <li>
            <h3>nom :  {data.product_name}</h3>
            <img src={data.image_front_small_url} alt="product"/>
         </li>
         </ul>
        </div>
         )) 
  );
}

export default ListProducts;
